  return (
    <Router>
      <Routes>
        <Route path='/' element={ <Home /> }></Route>
        <Route path='/about' element={ <AboutPage /> }></Route>
        <Route path='/shows' element={ <ShowsPage /> }></Route>
      </Routes>
    </Router>

  );
}

export default App;
